import React, { useState } from 'react';
import Stereo from './Stereo.js';

function App() {
  return (
    <>
     <Stereo />
     <input type="text"></input>
     <button>Funkadelic</button>
     <button>Hip Hop</button>
     <button>Focus</button>
     <button>00s</button>
     <button>90s</button>
     <button>80s</button>
     <button>70s</button>
     <button>60s</button>
    </>

  )
}

export default App;
